    - type: Paper
      content: >-
        _____________________________________________________________

        Дневник руководителя

        Постройки Awesome Station

        _____________________________________________________________

        Очень хорошо, кто-то очень внимательный нашел мой офис. Кто бы ты не был. Теперь ты тоже повязан. Если ты расскажешь об том что ты тут видишь общественному взору. Будь уверен. Я сделаю все чтобы тебе тоже досталось наказание. Лучше сделай всё чтобы никто об этом месте никогда не узнал (уничтожить улики тебе надо если ты несмышлёный)

        1.___________________________________________________________


        Доставка моей золотой статуи на станцию задерживается. Очень плохо. Люди начинают думать что на станцию денег почти не потрачено. Нужно доказать обратное.

        Одной из статей на которую мне выделили деньги было земельные работы. Пришлось для отчетности выставить инженеров в рядок, выдать им лопаты и заставить копать вакуум. Позже пригнали экскаватор. Отчет приняли, но вместо стройки станции мы занимались этой клоунадой.

        2.___________________________________________________________


        Начались сильные волнения по поводу урезания зарплат и пайков. Для моей безопасности стоит установить пару турелей для защиты меня. И если пару главных организаторов резко куда-то пропадёт, то все должно успокоиться.

        3.___________________________________________________________


        Странный мужик в шляпе, с очками с носом и усами пришёл ко мне. Он указал мне на плане станции несколько мест. Мне нужно было оставить там пространство и заложить разные предметы и объекты которые мне предоставят. Все должно быть тайно. За это обещал деньги сейчас и ещё больше потом.

        К сожалению предоставленные ящики продали инженеры ради водки. Пришлось замуровать где-то то самих этих инженеров где-то, что было на складе.

        4.___________________________________________________________


        Приходил инспектор из НТ. Его впечатлило качество станции. Очень доволен. Но причиной было то что по его информации с нашей станции шла торговля оружием. Кто-то занимался сбытом грузов синдиката. Я не понимаю о чем он. Но теперь вся наша строительная бригада под следствием

        5.___________________________________________________________


        Пропажа десятка работников Нечеловеческие условия труда, Мизерная оплата, нарушение прав человека, пытки на рабочем объекте, растрата бюджета станции на бесполезные вещи. Эти все нарушения мне не инкриминируют. Ко мне в принципе никаких вопросов нет. Работа моя сделана потрясающе. Мне выдадут премию и медаль. Вот вся строительная бригада сейчас под расследованием за торговлю с синдикатом.

        Но это не важно. Уже скоро прибудет первая смена. Я очень надеюсь им понравиться моя работа.

        6.___________________________________________________________
